import React from 'react';

const EditButton = ({ id, onClick }) => {
    return (
        <button
            onClick={() => onClick(id)}
            className="bg-blue-500 hover:bg-blue-600 text-white px-2 py-1 rounded text-xs"
        >
            Edit
        </button>
    );
};

export default EditButton;
